description:
WEIZENMEHL, Zucker, Palmfett, 8% rote Ribisel, Trinkwasser,
Feuchthaltemittel: Sorbit; pflanzliche Öle: Raps, Sonnenblume in
veränderlichen Gewichtsanteilen; Maisstärke, Kakaomasse, Kakaobutter,
VOLLEIPULVER, Trockenmolkenzubereitung: SÜSSMOLKENPULVER, MILCHFETT;
modifizierte Stärke, Geliermittel: Pektine; WEIZENQUELLMEHL,
Maisquellstärke, Backtriebmittel: Diphosphate,
Natriumhydrogencarbonat; Emulgator: Lecithine (SOJA); Aroma (enthält
MILCH), Speisesalz, Gewürze, Säuerungsmittel: Citronensäure;
Stabilisator: Calciumcitrate; Konservierungsstoff: Kaliumsorbat;
Kaliumjodat. Zartbitterschokolade: enthält mindestens 58% Kakao.
